          </div>
        </div>} */}
       
       <Navbar className="row p-2 d-flex" color="light">
        <NavbarBrand className='col-7 d-flex justify-content-start ms-4' href="/">
          <img alt="logo" src="Nexadz.png" style={{height: 25,width: 100}}/>
        </NavbarBrand>
        <NavbarText className='col-3 d-flex justify-content-end'>
          <div className='d-flex'>
            <div><img alt="" src="person.svg" className='bg-primary p-2 mt-2 me-2 rounded'/></div>
            <div>
              <div>Administrator</div>
              <div>
              <UncontrolledDropdown>
              <DropdownToggle nav caret>
                Ismail EL bouzidi
              </DropdownToggle>
              <DropdownMenu right>
                <DropdownItem className='d-flex'><img alt="" src="person.svg" className=''/>View Profile</DropdownItem>
                <DropdownItem>Account Setting</DropdownItem>
                <DropdownItem divider />
                <DropdownItem>Sign out</DropdownItem>
              </DropdownMenu>
            </UncontrolledDropdown>
              </div>
            </div>
          </div>
        </NavbarText>
    
    </Navbar>
    </div>
      
      
    );
